window.bookSummaryJSON = "<p><b>My name is Alana Montoya.</b></p> <p>My husband is the King of L.A. And I am his Queen. I never asked for this life, but now that it’s mine, I will fight for it with every breath in my body.</p> <p>Our love is fire and fury, burning brighter than the heat of a thousand suns. But when secrets and betrayal threaten our chance at happiness, will the flames be enough to vanquish our enemies, and destroy our doubts and fears? Or will the ashes and embers of what we once had be all that remains?</p> <p>A war is coming to L.A, and when it is over, only one side will be left standing. A fierce King will burn the whole world down to get what he wants. But a wise King knows that he can’t win a war alone.</p> <p>Because when all is said and done, everyone knows that the Queen is the most powerful player on the board.</p> <p><i>Fierce Queen</i> is an enemies to lovers, forced marriage, dark mafia romance, which contains scenes and themes of an adult nature.</p>"; 
